import App from './App';
import { createBrowserRouter } from 'react-router-dom';
import React from 'react';
import ReactDOM from 'react-dom/client';

const router = createBrowserRouter([
  {
    path: '/',
    element: <App />,
  },
]);

ReactDOM.render(
  <router.Provider>
    <App />
  </router.Provider>,
  document.getElementById('root')
);
